import React from "react";

const AboutMe = () => {
	return (
		<div className="about_me_container">
			<div>/about_me</div>
			<p> I'm Nelson Rodriguez </p>
			<p> A Developer and CS Alum from Georgia Tech </p>
		</div>
	);
}

export default AboutMe;
